import React, { useEffect, useState } from 'react'
import Damaged_Material_Details from './Damaged_Material_Details'
import { SemanticToastContainer, toast } from 'react-semantic-toasts';
import Response_Handler from '../Response_Handler'
import { damageUrl, damagesStatesUrl } from '../Links'
import axios from 'axios'

function Damage_Material_Active_Details(props) {

    const [material_report, setMaterial_Report] = useState({
        id: '',
        material: '',
        description: '',
        start_date: '',
        report: null,
        close_date: null,
        state: '',
        request: null,
        user: '',
        states: []
    })

    useEffect(() => {
        const id = props.match.params['id']
        axios.get(damageUrl.replace(':id', id))
            .then(resp => {
                axios.get(damagesStatesUrl)
                    .then(r => {
                        setMaterial_Report({
                            ...resp.data,
                            states: r.data['states']
                        })
                    }).catch(err => Response_Handler(err.response))
            }).catch(err => Response_Handler(err.response))
    }, [])

    function onCancel() {
        props.history.goBack()
    }

    function onSave() {
        const button = document.getElementById('confirm')
        if (material_report.report === undefined) {
            return toast({
                type: 'warning',
                title: 'Falta de Informação',
                description: 'Insira uma Descrição a associar à Avaria',
                time: 2000,
                size: 'mini'
            })
        }
        if (material_report.state === 'por_resolver') {
            return toast({
                type: 'warning',
                title: 'Falta de Informação',
                description: 'Altere o Estado a associado à Avaria',
                time: 2000,
                size: 'mini'
            })
        }
        button.disabled = true
        axios.patch(damageUrl.replace(':id', material_report.id), { "state": material_report.state, "report": material_report.report })
            .then(resp => {
                Response_Handler(resp)
                setTimeout(() => props.history.goBack(), 2000)
            }).catch(err => {
                Response_Handler(err.response)
                button.disabled = false
            })
    }

    function changeState(value) {
        if (value === 'all') return
        setMaterial_Report({
            ...material_report,
            state: value
        })
    }

    return (
        <div>
            <SemanticToastContainer />
            <Damaged_Material_Details
                changeState={changeState}
                material_report={material_report}
                changeMaterialReport={(value) => setMaterial_Report(value)}
                onSave={onSave}
                onCancel={onCancel}
            />
        </div>
    )



}
export default Damage_Material_Active_Details
